// SPDX-License-Identifier: MIT
pragma solidity ^0.8.4;
import "@openzeppelin/contracts/utils/Counters.sol";
import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "./interfaces/IMilkToken.sol";

contract Staking is ReentrancyGuard, Ownable {
    using Counters for Counters.Counter;
    
    struct StakingItem {
        uint256 itemId;
        address contractAddress;
        address owner;
        uint256 tokenId;
        uint256 pendingMilk;
        uint256 poolId;
        bool isEnded;
    }

    struct PoolInfo {
        address contractAddress;
        uint256 allocPoint;
        uint256[] tokenIds;
        uint256 milkPower;
        uint256 maxStakedCount;
        uint256 lastUpdatedBlock;
    }

    mapping(address => uint256) public poolIdOfContract;

    Counters.Counter public stakingPoolCount;
    Counters.Counter public stakingItemCount;
    IMilkToken tokenMilk;
    
    uint256 public milkPerBlock;
    uint256 public totalAllocPoint;
    uint256 public totalAmountDepositedPool;
    uint256 public startBlock;
    uint256 public endBlock;
    bool public isStakingAvailable;
    mapping(uint256 => PoolInfo) public pools;
    mapping(uint256 => StakingItem) public items;

    event StakingItemCreated(
        uint256 itemId,
        address indexed nftContract,
        address indexed owner,
        uint256 tokenId
    );

    event Harvest(
        uint256 itemId,
        address indexed owner,
        uint256 amount
    );

    constructor(IMilkToken _tokenMilk) {
        tokenMilk = _tokenMilk;
        totalAllocPoint = 0;
        milkPerBlock = 0;
        totalAmountDepositedPool = 0;
        isStakingAvailable = false;
    }

    function depositMilkToPool(uint256 _totalAmountDepositedPool, uint256 _startBlock, uint256 _endBlock) public onlyOwner {
        require(tokenMilk.balanceOf(owner()) >= _totalAmountDepositedPool, "insufficient Milk amount to Deposit");
        require(_endBlock > block.number, "End Block must bigger than now");
        require(_endBlock > _startBlock, "End Block Number must bigger than Start Block Number");
        tokenMilk.transferFrom(owner(), address(this), _totalAmountDepositedPool * 10 ** 18);
        totalAmountDepositedPool = _totalAmountDepositedPool;
        startBlock = _startBlock;
        endBlock = _endBlock;
        milkPerBlock = 10 ** 6 * _totalAmountDepositedPool / (_endBlock - _startBlock);
        isStakingAvailable = true;
    }

    function setPeriod(uint256 _startBlock, uint256 _endBlock) public onlyOwner {
        require(_endBlock > block.number, "End Block must bigger than now");
        require(_endBlock > _startBlock, "End Block Number must bigger than Start Block Number");
        milkPerBlock = 10 ** 6 * totalAmountDepositedPool / (_endBlock - _startBlock);
        startBlock = _startBlock;
        endBlock = _endBlock;
    }    

    function setIsStakingAvailable(bool _isStakingAvailable) public onlyOwner{
        isStakingAvailable = _isStakingAvailable;
    }

    function addPool(address _contractAddress, uint256 _allocPoint, uint256[] calldata _tokenIds, uint256 _milkPower, uint256 _maxStakedCount) public onlyOwner {
        require(startBlock != 0 && endBlock != 0, "Reward Token not deposited yet!");
        stakingPoolCount.increment();
        uint256 poolId = stakingPoolCount.current();

        pools[poolId] = PoolInfo(
            _contractAddress,
            _allocPoint,
            _tokenIds,
            _milkPower,
            _maxStakedCount,
            startBlock
        );

        poolIdOfContract[_contractAddress] = poolId;

        totalAllocPoint = totalAllocPoint + _allocPoint;
    }

    function updatePool(
        uint256 _poolId, 
        address _contractAddress, 
        uint256 _allocPoint, 
        uint256[] calldata _tokenIds,
        uint256 _milkPower, 
        uint256 _maxStakedCount
    ) public onlyOwner {
        require(_poolId <= stakingPoolCount.current(), "invalid poolId");

        totalAllocPoint = totalAllocPoint - pools[_poolId].allocPoint;

        pools[_poolId] = PoolInfo(
            _contractAddress,
            _allocPoint,
            _tokenIds,
            _milkPower,
            _maxStakedCount,
            pools[_poolId].lastUpdatedBlock
        );

        poolIdOfContract[_contractAddress] = _poolId;

        totalAllocPoint = totalAllocPoint + _allocPoint;
    }

    modifier isValid(address _msgSender, address _contractAddress, uint256 _tokenId) {
        require(IERC721(_contractAddress).ownerOf(_tokenId) == _msgSender, "not owner");
        _;
    }

    function _updatePendingMilk(uint256 _poolId) internal {

        /**Update the Pending Milk for All Items */
        uint256 tmpEndBlock = 0;
        if(block.number > endBlock)
            tmpEndBlock = endBlock;
        else 
            tmpEndBlock = block.number;
        uint256 totalMilkPower = getTotalMilkPower(_poolId);
        for(uint256 i = 1; i <= stakingItemCount.current(); i ++) {
            if(items[i].isEnded == false && items[i].poolId == _poolId) {
                uint256 amount = milkPerBlock * (tmpEndBlock - pools[_poolId].lastUpdatedBlock) *  pools[_poolId].allocPoint / totalAllocPoint * pools[_poolId].milkPower / totalMilkPower;  
                items[i].pendingMilk += amount;
            }
        }
        pools[_poolId].lastUpdatedBlock = tmpEndBlock;
        /**End Update */
    }

    function stake(
        address _nftContract,
        uint256 _tokenId
    ) public nonReentrant isValid(msg.sender, _nftContract, _tokenId) {

        require(block.number >= startBlock && block.number <= endBlock && isStakingAvailable == true, "Staking is not started!");

        uint256 poolId = poolIdOfContract[_nftContract];
        require(poolId != 0, "There is no Contract Address in Pool");
        

        uint256 myStakedCount = getMyStakedCount(poolId, msg.sender);
        require(myStakedCount < pools[poolId].maxStakedCount, "Overflow of Max Staking Count");

        _updatePendingMilk(poolId);

        stakingItemCount.increment();
        uint256 itemId = stakingItemCount.current();

        items[itemId] = StakingItem(
            itemId,
            _nftContract,
            msg.sender,
            _tokenId,
            0,
            poolId,
            false
        );

        IERC721(_nftContract).transferFrom(msg.sender, address(this), _tokenId);
        
        emit StakingItemCreated(
            itemId,
            _nftContract,
            msg.sender,
            _tokenId
        );
    }

    function getAllocPoint(uint256 _itemId) internal view returns(uint256) {
        for(uint256 i = 1; i <= stakingPoolCount.current(); i++) {
            if (pools[i].contractAddress == items[_itemId].contractAddress) {
                return pools[i].allocPoint;
            }
        }
        return 0;
    }
    function _harvest(
        uint256 _itemId,
        address _owner
    ) internal {
        StakingItem storage item = items[_itemId];
        require(_itemId <= stakingItemCount.current(), "invalid Item Id");
        require(_owner == items[_itemId].owner, "Not owner of this Item" );

        uint256 amount = items[_itemId].pendingMilk;
        require(tokenMilk.balanceOf(address(this)) >= amount, "insufficient Milk amount to harvest");

        tokenMilk.transfer(item.owner, amount * 10 ** 12);
        items[_itemId].pendingMilk = 0;
        emit Harvest(_itemId, item.owner, amount);
    }

    function harvest(uint256 _poolId) public {

        _updatePendingMilk(_poolId);
        for(uint256 i = 1; i <= stakingItemCount.current(); i ++) {
            if(items[i].owner == msg.sender && items[i].isEnded == false && pools[_poolId].contractAddress == items[i].contractAddress) {
                _harvest(i, msg.sender);
            }
        }
    }

    function getPendingMilk(uint256 _itemId) public view returns(uint256){
        uint256 amount = items[_itemId].pendingMilk;
        uint256 tmpEndBlock = 0;
        uint256 poolId = items[_itemId].poolId;
        uint256 totalMilkPower = getTotalMilkPower(poolId);
        if(block.number > endBlock)
            tmpEndBlock = endBlock;
        else 
            tmpEndBlock = block.number;
        amount += milkPerBlock * (tmpEndBlock - pools[poolId].lastUpdatedBlock) *  pools[poolId].allocPoint / totalAllocPoint * pools[poolId].milkPower / totalMilkPower;
        return amount;
    }

    function getPendingMilkForAll(uint256 _poolId) public view returns(uint256){
        uint256 amount = 0;
        for(uint256 i = 1; i <= stakingItemCount.current(); i ++) {
            if(!items[i].isEnded && items[i].poolId == _poolId)
                amount += getPendingMilk(i);
        }
        
        return amount;
    }

    function getStakedItems(address _owner) public view returns(StakingItem[] memory){
        uint256 totalItemCount = stakingItemCount.current();
        uint256 itemCount = 0;
        uint256 currentIndex = 0;

        for(uint256 i = 1; i <= totalItemCount; i ++) {
            if(_owner == items[i].owner && items[i].isEnded == false) {
                itemCount += 1;
            }
        }

        StakingItem[] memory stakedItems = new StakingItem[](itemCount);
    
        for (uint256 i = 1; i <= totalItemCount; i ++) {
            if(_owner == items[i].owner && items[i].isEnded == false) {
                StakingItem storage currentItem = items[i];
                stakedItems[currentIndex] = currentItem;
                currentIndex += 1;
            }
        }

        return stakedItems;

    }
   
    function getBlockNumber() public view returns(uint256) {
        return block.number;
    }

    function getTotalStakedCount(uint256 _poolId) public view returns(uint256) {
        uint256 count = 0;
        for(uint256 i = 1; i <= stakingItemCount.current(); i ++)
        {
            if(items[i].isEnded == false && items[i].contractAddress == pools[_poolId].contractAddress) {
                count ++;
            }
        }
        return count;
    }

    function getTotalMilkPower(uint256 _poolId) public view returns(uint256) {
        uint256 count = getTotalStakedCount(_poolId);
        uint256 totalMilkPower =  count * pools[_poolId].milkPower;
        return totalMilkPower;
    }

    function getMyMilkPower(uint256 _poolId, address _owner) public view returns(uint256) {
        uint256 count = 0;
        for(uint256 i = 1; i <= stakingItemCount.current(); i ++)
        {
            if(items[i].isEnded == false && items[i].contractAddress == pools[_poolId].contractAddress && items[i].owner == _owner) {
                count ++;
            }
        }
        uint256 myMilkPower =  count * pools[_poolId].milkPower;
        return myMilkPower;
    }

    function getMyStakedCount(uint256 _poolId, address _owner) public view returns(uint256) {
        uint256 count = 0;
        if(stakingItemCount.current() < 1)
            return 0;
        for(uint256 i = 1; i <= stakingItemCount.current(); i ++)
        {
            if(items[i].isEnded == false && items[i].contractAddress == pools[_poolId].contractAddress && items[i].owner == _owner) {
                count ++;
            }
        }
        return count;
    }

    function getDailyMilkRate(uint256 _poolId) public view returns(uint256) {
        uint256 totalMilkPower = getTotalMilkPower(_poolId);
        uint256 dailyRate = 0;
        if(totalMilkPower != 0)
            dailyRate = milkPerBlock * 20 * 60 * 24 * 100 / totalMilkPower * pools[_poolId].allocPoint / totalAllocPoint;
        return dailyRate;
    }

    function unstake(
        uint256 _itemId
    ) public {
        StakingItem storage item = items[_itemId];

        require(item.owner == msg.sender, "you are not owner");
        require(item.isEnded == false, "This Staking Item was unstaked already!");

        _updatePendingMilk(item.poolId);

        _harvest(_itemId, msg.sender);
        IERC721(item.contractAddress).transferFrom(address(this), msg.sender, item.tokenId);
        item.isEnded = true;
    }

    function withDraw() public onlyOwner {
        require(block.number > endBlock, "Staking is not finished");
        uint256 remainBalance = tokenMilk.balanceOf(address(this));
        tokenMilk.transfer(owner(), remainBalance);
        isStakingAvailable = false;
    }
}
